import { Fragment} from "react";
import {BrowserRouter, Switch, Route} from "react-router-dom";
//ページのインポート
import Login from "./Login";
import Signup from "./Signup";
import Room from "./Room";

const App = () => {
    return (
        <BrowserRouter>
            <Switch> 
                <Route exact path= "./">
                    <Room />
                </Route>
                <Route exact path= "./login">
                    <Signup />   
                </Route>
                <Route exact path = "./signup">
                    <Login />
                </Route>

            </Switch>
        </BrowserRouter>
    );
};
export default App;
